import React from "react";
import a from "./Manage"
class Label extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className={"label"}>
                <div className="statistics-box">
                    <h2 className="statistics-header statistics-header--income">:</h2>

                    <ul id="incomes-list" className="statistics-list">
                    </ul>
                </div>
                <span>Temperature: {this.props.temperature}</span><br/>
                <span>Value: {this.props.value}</span>
                <div className="statistics-box">
                    <h2 className="statistics-header statistics-header--expense">{a}:</h2>
                    <ul id="expenses-list" className="statistics-list"></ul>
                </div>
            </div>
        )
    }
}
export default Label
